(32, 'Cookie Policy', '<h3>EU Cookie Consent</h3><p>Để sử dụng trang web này, chúng tôi đang sử dụng Cookie và thu thập một số Dữ liệu. Để tuân thủ GDPR của Liên minh Châu Âu, chúng tôi cho bạn lựa chọn nếu bạn cho phép chúng tôi sử dụng một số Cookie nhất định và thu thập một số Dữ liệu.</p><h4>Dữ liệu cần thiết</h4><p>Dữ liệu cần thiết là cần thiết để chạy Trang web bạn đang truy cập về mặt kỹ thuật. Bạn không thể hủy kích hoạt chúng.</p><p>- Session Cookie: PHP sử dụng Cookie để xác định phiên của người dùng. Nếu không có Cookie này, trang web sẽ không hoạt động.</p><p>- XSRF-Token Cookie: Laravel tự động tạo \"token\" CSRF cho mỗi phiên người dùng đang hoạt động do ứng dụng quản lý. Token này được sử dụng để xác minh rằng người dùng đã xác thực là người thực sự đưa ra yêu cầu đối với ứng dụng.</p>', 1, NULL, 'default', 0, NULL, 'published', '2021-10-06 14:09:33', '2021-10-06 14:09:33'),
(33, 'Home 6', '<shortcode class=\"bb-shortcode\">[hero-banner title=\"لتنظيم معاملات البدل السكني &nbsp;بين العائلات الكويتية \" bg=\"banners/banner-6-1.png\" overlay=\"0\" style=\"6\"]الابليكش الأول في الكويت [/hero-banner]</shortcode><shortcode class=\"bb-shortcode\">[static-block alias=\"alaksam\"][/static-block]</shortcode><shortcode class=\"bb-shortcode\">[featured-properties title=\"الصفقات المعروضة للبدل موخراً\" limit=\"6\" style=\"1\"][/featured-properties]</shortcode><shortcode class=\"bb-shortcode\">[google-map][/google-map]</shortcode>\r\n\r\n\r\n<iframe src=\"demo_iframe.htm\" style=\"border:none;\" title=\"Iframe Example\"></iframe>', 2, NULL, 'homepage', 1, NULL, 'published', '2022-01-22 05:12:52', '2022-02-14 23:58:57');
