(38, 'الشروط و األحكام', '<p style=\"text-align:right;\">الشروط و الأحكام<br>تشكل الشروط والاحكام الواردة فيما يلي اتفاقية قانونية )\"اتفاقية\"( بين المستخدم و الوارد أسمه و المشار إليه في صفحة التسجيل في تطبيق بدل باسم المستخدم و بين الشركة ) الشركاء – القائمين / الملاك و المدراء المتمثلين في شركة بيبان الكويت العقارية ( لتطبيق بدل و يشار إليهم جميعا أحيانا باسم إدارة التطبيق.</p><p style=\"text-align:right;\">الخدمة و الدعم : يقدم تطبيق بدل خدمة إلكترونية عبارة عن ) عرض و أستعراض العقار المملوك للمستخدم بهدف البيع بطريقة التبادل/ التنازل عن العقار من طرف مقابل عقار مملوك لطرف آخر لديه نفس الرغبة ، و يقدم التقدم مجموعة من الخصائص التي تسهل على الطرفين معرفة تفاصل العقار و موقعه ...إلخ ، و يشترط عند رغبة المستخدم التمتع بهذه الخدمة المقدمة من تطبيق بدل و الخصائص الألكترونية التي يقدمها التسجيل الألكتروني في التطبيق بمعلومات صحيحة عن لمستخدم و عن العقار المملوك / التابع له محل العرض ، و يمّكن تطبيق بدل المستخدمين من أستعراض العقار المعروض و المزايدة عليه حسب آليه محددة و واضحة ، كما يمكن للمستخدم إلغاء<br>خاصية المزايدة على عقاره و تثبيت السعر المرغوب به من قبله .</p><p style=\"text-align:right;\">( و يكون المستخدم عند أستخدامه لتطبيق بدل متحملا لكافة المسؤوليات القانونية عن المعلومات التي يقدمها كما يكون عند الموافقة على هذه الأتفاقية عارفا بغرضه معرفة نافية للجهالة بما يقدمه التطبيق و ذلك مقابل تمتعه بالخدمة المقدمة من تطبيق بدل .</p><p style=\"text-align:right;\">لا تتاح خدمات تطبيق بدل لغير الأشخاص ) رب الأسرة الكويتي ، أو المواطن الكويتي ، الذي قام بتخصيص عقار سكني لدى المؤسسة العامة للرعاية السكنية ، في أحد المناطق المحددة في دولة الكويت ، أو لرب الأسرة الكويتي ، أو المواطن الكويتي الذي يتملك عقارا سكنيا في أحد المناطق السكنية في دولة الكويت ( و لا يتاح لأحد أقربائه من الدرجة الأولى أو غيرها ) الزوجة ، الأبن ، الأخ ، الاب ، الأم ، الجد ، العم ، الخال ..... إلخ ( أتخدام التطبيق و رفع أي بيانات بالنيابة عنه ، أو بتوكيل منه ، إلا في حال أمتلاكه لتوكيل رسمي صادر عن وزارة العدل في دولة الكويت منصوص فيه التصرف في ذك العقار المشار لمثل صفته في الأعلى ، و إلا يتحمل ذلك الطرف بمن فيهم صاحب التخصيص / العقار السكني المسؤولية كاملة و لا تتحمل إدارة التطبيق أي مسؤولية قانونية أو جنائية تنشئ جراء هذا ، و لا يعتبر الجهل أو عدم الدراية عذرا في هذه الحال ، حيث أن تطبيق بدل يحدد لكل مستخدم أثناء التسجيل معلومات شخصية ومعلومات عن العقار السكني و بيانات رسمية يجب أن لا تكون معروفة إلا لصاحب الشأن بشخصية أو بالوكيل الرسمي عنه بتوكيل منه.<br>موافقة المستخدم على هذه الشروط و الأحكام المحددة و المسماة بالأتفاقية بينه و بين إدارة التطبيق أثناء التسجيل على ملئ كافة الحقول والخانات المطلوبة ، و يقر بأنها معلومات صحيحة خاصة به و بعقاره السكني الذي يرغب في عرضه ) للبدل ( ، و عله فإنه يتحمل كافة التبعات القانونية جراء أي خطأ قد ينتج ، و يتحمل مسؤوليته ، كما يقر بأنه يرغب رغبة حقيقة و كاملة بإجراء البدل حسب رغبته و في حال قام بالموافقة لاحقا على أتمام صفقة البدل ) التبادل / التنازل ( فإنه يعلم أنه عرض نفسه لأي مطالبة مالية أو قانونية من قبل الطرف الآخر في حال التراجع أو عدم استكمال إجراءات الصفقة عبر قنوات الدولة الرسمية ، و في حال التفاهم على التراجع عن الصفقة فإنه يقوم بالتواصل / التخاطب مع إدارة التطبق و إبداء رغبته تلك في التراجع و يتم التفاهم بينه و بين الطرف الثاني و إتمام التراجع بشكل ودي عبر إجراءات تتخذها إدارة التطبيق لتأكيد أتما التراجع .</p><p style=\"text-align:right;\">التطبيق : يعتبر تطبيق بدل و إدارة التطبيق طرفا وسيط بين طرفين لديهما الرغبة في التبادل / التنازل لصالح كل طرف منها ، هدفهم تقديم خدمة تتيح و تسهل عملية التفاهم المبدئي ، و لا يعتبر ذلك التفاهم الحاصل بينهما ملزما قانونيا ، إلا عبر القنوات و المؤسسات و الأجراءات المتبعة في دولة الكويت لأتمام الأجراء اللذان يرغبان في القيام به و حسب الأليات المتبعة في هذا الشأن ، و يقتصر دورتطبيق بدل على ما يعرف ب \" الوساطة العقارية الألكترونية \" و الأعلان عن هذه العقارات المرغوب بيعها ) بطريقة البدل ( ) التنازل عن سكن أسرة من طرف أول مقابل التنازل عن سكن أسرة من طرف ثان ( و يعمل تطبيق بدل بر خصة تجارية سارية و نشاطها )<br>وساطة عقارية ( و أسمها التجاري ) شركة بيبان الكويت العقارية ( و سجلها التجاري رقم 352792 و رقم الترخيص الخاص بها 812 / 2014 و كيانها القانوني : شركة تضامنية و يعتبر تطبيق بدل أحد مشاريع شركة بيبان الكويت العقارية و مملوكا لها .</p><p style=\"text-align:right;\">المسؤوليات : هذة اتفاقية للخدمات المقدمة من تطبيق بدل ، ولا يمنح المستخدم ترخي صا لأي شيء بالبرنامج ما عدا التمتع بخدمات عرض العقار و المزايدة و أستعراض العقارات و التمتع بالخدمات المتاحة من قبل تطبيق بدل بموجب هذه الاتفاقية. لن يقوم المستخدم ، بشكل مباشر أو غير مباشر ، بإجراء هندسة عكسية أو إلغاء ترجمة أو تفكيك أو محاولة اكتشاف شفرة المصدر أو رمز الكائن أو البنية الأساسية أو الأفكار أو الخوارزميات أو المضمنة في الخدمات أو أي برنامج أو وثائق أو بيانات ذات صلة ب الخدمات )“البرامج”( ؛تعديل أو ترجمة أو إنشاء أعمال مشتقة بنا ء على الخدمات أو أي برامج ، أو نسخ أو توزيع أو رهن أو تخصيص أو نقل أو رث الحقوق<br>إلى الخدمات أو أي برامج ؛ استخدام الخدمات أو أي برامج لأغراض المشاركة بالوقت أو خدمة المكتب أو غير ذلك لصالح طرف ثالث؛ أو إزالة أي إشعارات أو علامات ملكية .</p><p style=\"text-align:right;\">يوافق ويضمن أن المستخدم لن يستخدم الخدمات إلا بما يتوافق مع سياسات الخصوصية الخاصة ب تطبيق بدل كما هوموضح أو يتم تقديمه إلى المستخدم )“السياسة”( وجميع القوانين المعمول بها )بما في ذلك على سبيل المثال لا الحصر السياسات والقوانين المتعلقة بالرسائل غير المرغوب فيها أو الخصوصية أو الفحش أو التشهير( .يقر المستخدم حال التسجيل أنه لن يقوم بأي شكل بمحاولة تزويد الموقع بأي بيانات وهمية</p>', 2, NULL, 'default', 0, NULL, 'published', '2022-02-27 22:52:39', '2022-06-16 09:45:19'),
