(40, 'للبدل بيت قائم في صباح الأحمد قطاع أ - 3', 'للبد ل بيت قائم في صباح الأحمد قطاع أ - 3 مساحة 600 متر مربع أرض\r\n– فضاء – قسيمة رقم 445 الموقع زاوية ثلاث شوارع – إرتداد 10\r\n14 متر ، العقار مقابل شارع مفتوح – واجهة شرقية – غربية –\r\nجنوبية – مدخل سهل مخرج سهل – قريب من مركز الضحية ، جمعية\r\nتعاونية', '<p>بيت قائم في صباح الأحمد قطاع أ - 3 مساحة 600 متر مربع أرض<br>– فضاء – قسيمة رقم 445 الموقع زاوية ثلاث شوارع – إرتداد 10<br>14 متر ، العقار مقابل شارع مفتوح – واجهة شرقية – غربية –<br>جنوبية – مدخل سهل مخرج سهل – قريب من مركز الضحية ، جمعية<br>تعاونية<br>أرغب بالبدل ف ي : صباح الأحمد ، المطلاع ، أم الهان ، فهد الأحمد ،<br>المنقف<br>10 أمتا ر - مع بناء قائم موقع بطن و ظهر شارعين أرتداد 9<br>مع دفع الفرق لي</p>', 'الجهراء', '{\"1\":\"768081-1942134897.jpg\",\"2\":\"768081-1942134897.jpg\",\"3\":\"768081-1942134897.jpg\"}', NULL, NULL, NULL, 300, '1500.00', 1, 576, 'day', 18, 'Botble\\RealEstate\\Models\\Account', 14, 1, 'approved', '2022-03-17', 0, 1, '29.368570', '47.67661891980362', 6, '2022-01-31 21:09:17', '2022-04-28 00:48:41', 7, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 0, NULL),
